import React, { useState } from "react";
import "./NavBarComponentStyle.css";
import {
  AiOutlineMenuFold,
  AiOutlineInstagram,
  AiOutlineWhatsApp,
  AiOutlineLinkedin
} from "react-icons/ai";
import { Link } from "react-router-dom";

function NavBarComponent() {
  const [toggleMenu, setMenuToggle] = useState(true);

  console.log(toggleMenu);
  return (
    <div>
      <div className="menu-container">
        <div
          className="toggler-button"
          onClick={() => {
            setMenuToggle(!toggleMenu);
          }}
        >
          <AiOutlineMenuFold size={"50px"} />
        </div>

        <div className="desktop-menu">
          <h1>Oraldo's Web</h1>

          <div
            className={
              toggleMenu
                ? "desktop-menu-items desktop-menu-items-hide hide-desktop-menu"
                : "desktop-menu-items desktop-menu-items-show hide-desktop-menu"
            }
          >
            <ul>
              <Link to="/">Home</Link>
              <Link to="/">Projects</Link>
              <Link to="/">Contact</Link>
              <Link to="/">Blog</Link>
            </ul>
          </div>
        </div>
      </div>

      <div
        className={
          !toggleMenu
            ? "drawer-container show-drawer"
            : "drawer-container hide-drawer "
        }
      >
        <ul>
          <Link to="/">Home</Link>
          <Link to="/">Projects</Link>
          <Link to="/">Contact</Link>
          <Link to="/">Blog</Link>
          <a href="" className="icon-style">
            <AiOutlineInstagram />
          </a>
          <a href="" className="icon-style">
            <AiOutlineWhatsApp />
          </a>
        </ul>
        {/* <a href="#">Instagram</a>
        <a href="#">Instagram</a>
        <a href="#">Instagram</a> */}
      </div>
    </div>
  );
}

export default NavBarComponent;
